import React, { useEffect, useState } from "react";
import { collection, db } from "../init-firebase";
import { getDocs } from "firebase/firestore";
import { useNavigate } from "react-router-dom";

const Reciever = () => {
  const [Doners, setDoners] = useState([]); // To store all the donors
  const [loading, setLoading] = useState(false); // To handle loading state
  const [showDonors, setShowDonors] = useState(false); // To show donor data when ready
  const [receiverBloodGroup, setReceiverBloodGroup] = useState(""); // To store the receiver's blood group
  const [filteredDoners, setFilteredDoners] = useState([]); // To store filtered donors based on blood group
const navigate=useNavigate('/reciever')
  // Function to fetch donor data from Firestore when the button is clicked
  const fetchDonorData = async () => {
    setLoading(true); // Start loading
    setShowDonors(true); // Show the donor list when the button is clicked

    try {
      const donerCollection = collection(db, "doners");
      const donerSnapshot = await getDocs(donerCollection);
      const donerList = donerSnapshot.docs.map((doc) => doc.data());
      setDoners(donerList); // Set all donors in the state
    } catch (error) {
      console.error("Error fetching donor data: ", error);
    } finally {
      setLoading(false); // Stop loading after the data is fetched or error occurred
    }
  };

  // Function to filter donors by the selected blood group
  const filterDonorsByBloodGroup = () => {
    const matchedDonors = Doners.filter(doner => doner.BloodGroup === receiverBloodGroup);
    setFilteredDoners(matchedDonors); // Set the filtered donors
  };

  // Function to handle contacting the donor
  const contactDonor = (contactNumber) => {
    alert(`You can contact the donor at: ${contactNumber}`);
    // Or open the phone dialer (useful on mobile)
    // window.location.href = `tel:${contactNumber}`;
  };

  return (
    <div>
      <center>
        <h1>Available Donor Data</h1>

        {/* Display the "Receiver" button */}
        {!showDonors && (
          <button onClick={fetchDonorData}>Receiver</button> // Click to fetch donors
        )}

        {/* Display the blood group selection if donors are fetched */}
        {showDonors && (
          <div>
            <h2>Select your Blood Group:</h2>
            <select
              value={receiverBloodGroup}
              onChange={(e) => setReceiverBloodGroup(e.target.value)}
            >
              <option value="">Select Blood Group</option>
              <option value="A+">A+</option>
              <option value="A-">A-</option>
              <option value="B+">B+</option>
              <option value="B-">B-</option>
              <option value="AB+">AB+</option>
              <option value="AB-">AB-</option>
              <option value="O+">O+</option>
              <option value="O-">O-</option>
            </select>

            {/* Button to filter donors by selected blood group */}
            <button onClick={filterDonorsByBloodGroup}>
              Find Donors with Your Blood Group
            </button>
          </div>
        )}

        {/* Display Loading message if data is being fetched */}
        {loading && <p>Loading donors...</p>}

        {/* Display No Donors Found if the list is empty */}
        {Doners.length === 0 && !loading && showDonors && <p>No donors found.</p>}

        {/* Display filtered donor data if available */}
        {filteredDoners.length > 0 && (
          <div>
            {filteredDoners.map((doner, index) => (
              <div key={index} className="donor" style={{ marginBottom: "20px" }}>
                <h3>Name: {doner.Name || "N/A"}</h3>
                <p>Age: {doner.Age || "N/A"}</p>
                <p>Contact Number: {doner.ContactNumber || "N/A"}</p>
                <p>Blood Group: {doner.BloodGroup || "N/A"}</p>
                <button onClick={() => contactDonor(doner.ContactNumber)} oncli>
                  Contact Donor
                </button>
              </div>
            ))}
          </div>
        )}

        {/* If no matching donors are found */}
        {receiverBloodGroup && filteredDoners.length === 0 && (
          <p>No donors found with blood group {receiverBloodGroup}</p>
        )}
      </center>
    </div>
  );
};

export default Reciever;
